import React from "react";
import img from "../../images/meme.jpg";
import { Back } from "./NotFoundElements";

const PageNotFound = () => {
  return (
    <div>
      <Back>
        <img
          src={img}
          alt="linus"
          style={{
            "background-position": "center",

            //height: "100vh",
            //width: "100vw",
          }}
        />
      </Back>
    </div>
  );
};

export default PageNotFound;
